function getLocation() {
  var xPos;
  var yPos;
  var promise = new Promise(function(resolve, reject) {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(function(position){
        resolve([position.coords.latitude, position.coords.longitude])
      });
    } else {
      reject("Unknown");
    }});
  return promise;
}

function isPersonInDangerZone(personLat, personLong, polyLats, polyLongs){
    var i;
    var angle = 0;
    var point1_lat;
    var point1_long;
    var point2_lat;
    var point2_long;

    for (i = 0; i < polyLats.length; i++) {
         point1_lat=polyLats[i]-personLat;
         point1_long=polyLongs[i]-personLong;
         point2_lat=polyLats[(i+1)%polyLats.length]-personLat; // uses modulas for the last values in the array
         point2_long=polyLongs[(i+1)%polyLats.length]-personLong;
         angle += Angle2D(point1_lat,point1_long,point2_lat,point2_long);
    }

    if(Math.abs(angle)<Math.PI) {
    	console.log("you here")
    	document.getElementById("yesno").className = " no ";
    	document.getElementById("yesno").innerHTML = "SAFE ZONE";
        return false;
    }
    else {
        document.getElementById("yesno").className = " yes ";
        document.getElementById("yesno").innerHTML = "TSUNAMI ZONE";
        var safeZone = closestSafeZone(personLat, personLong)
        calcRoute(personLat, personLong,safeZone.geometry.coordinates[1], safeZone.geometry.coordinates[0])

      return true;
    }
}

/**
 * Returns angle for equation
 * Helper method for isPersonInDangerZone
 */
function Angle2D(y1, x1, y2, x2){
var dtheta,theta1,theta2;
theta1=Math.atan2(y1,x1);
theta2=Math.atan2(y2,x2);
dtheta=theta2-theta1;
while (dtheta > Math.PI)
    dtheta -= (Math.PI*2);

while (dtheta < -Math.PI)
      dtheta += (Math.PI*2);

   return(dtheta);
}

